enerate the majority of our sales. We can take advantage of this by expanding there and offering promotions that are only available there. Additional study should be conducted to determine why sales are low  in countries like Japan and, once we have that information, relevant solutions can be developed."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":12.873706,"end_time":"2022-10-22T14:44:17.222116","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-10-22T14:44:04.34841","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}